svg.script:
setTimeout(function() {
	var el = document.getElementById("stop2");
	var interval = setInterval(function() {
		if (el.offset.baseVal >= 1) {
			var newEl = document.getElementById("stop1");
			var newInterval = setInterval(function() {
				if (newEl.offset.baseVal >= 1) {
					clearInterval(newInterval);
				} else {
					newEl.offset.baseVal += .01;
				}
			}, 10);
			clearInterval(interval);
		} else {
			el.offset.baseVal += .003;
		}
	}, 10);
}, 7500);
